const router=new VueRouter({mode:"history",base:"/InstaBulk/",routes:[]}),app=new Vue({router:router,components:{"vue-recaptcha":VueRecaptcha},data:()=>({loader:!0,wait:!0,ad:!1,bulks:"",bulksList:[],button:{text:"Şimdi Sonuçlar Listele",icon:"search",color:"purple",click:!1}}),methods:{checkBulk:function(){const t=this;let s=this.bulks.replace(" ","").split("\n").filter(t=>""!==t).filter((t,s,e)=>e.indexOf(t)===s);t.bulksList=[],s.forEach(function(s){t.bulksList.push({nick:s,type:"wait",usable:!1,possible:!0})}),this.bulksList[0]?($("html, body").animate({scrollTop:$(".content").offset().top},1e3,"swing",function(){t.wait=!1}),$.each(t.bulksList,function(s,e){axios({url:"http://localhost/ideasoft/instagram.php",responseType:"json",params:{nick:e.nick}}).then(function(e){t.bulksList[s].usable=e.data.usable,t.bulksList[s].possible=e.data.possible,t.bulksList[s].type=e.data.possible?e.data.usable?"check":"times":"exclamation"})})):this.changeButton("Boş Kontrol Yapılamaz","times","danger")},changeButton:function(t,s,e="purple",o=1500){const i=this,n=this.button;this.button.click||(this.button={text:t,icon:s,color:e,click:!0},setTimeout(function(){i.button=n},o))}},mounted(){this.loader=!1}}).$mount("#app");